import "./styles.css";
import Pokemon from "../Pokemon";

const Modal = ({ pokemon, selected }) => {
  return (
    <div className="modal">
      <Pokemon
        key={pokemon.id}
        img={pokemon.img}
        name={pokemon.name}
        type={pokemon.type[0]}
        height={pokemon.height}
        weight={pokemon.weight}
      />
    </div>
  );
};

export default Modal;
